import PropTypes from 'prop-types'
import Button from './Button'

const Header = ({
  title
}) => {
  const onClick = (e) => {
    console.log(e)
  }
  return (
    <header>
      <h1>{ title }</h1>
      <Button color='red' text='Add' onclick={onclick}></Button>
    </header>
  )
}

Header.defaultProps = {
  title: 'Task Tracker'
}

Header.propTypes = {
  title: PropTypes.string
}

export default Header
